import React from 'react';

// Defining a dragon
class drgn {
    constructor(name,type,habitat,trainable,atk,speed,armor,firepower,shotlimit,venom,jawstrength,stealth) {
        this.name = name;
        this.type = type;
        this.habitat = habitat;
        this.trainable = trainable;
        this.atk = atk;
        this.speed = speed;
        this.armor = armor;
        this.firepower = firepower;
        this.shotlimit = shotlimit;
        this.venom = venom;
        this.jawstrength = jawstrength;
        this.stealth = stealth;
    }
}

// Creating the HTYD dragons
const Armorwing = new drgn('Armorwing','mistery','caves',true,12,7,50,10,4,0,11,1);


export const Body = () => {
    return ( 
        <div>
            {/* Here goes a table*/}
            <table>
                <tbody>
                    <tr>
                        <td>Type:</td>
                        <td>{Armorwing.type}</td>
                    </tr>
                    <tr>
                        <td>Habitat:</td>
                        <td>{Armorwing.habitat}</td>
                    </tr>
                    <tr>
                        <td>Trainable:</td>
                        <td>{Armorwing.trainable ? "Yes" : "No"}</td>
                    </tr>
                    <tr>
                        <td>Attack:</td>
                        <td>{Armorwing.atk}</td>
                    </tr>
                    <tr>
                        <td>Speed:</td>
                        <td>{Armorwing.speed}</td>
                    </tr>
                    <tr>
                        <td>Armor:</td>
                        <td>{Armorwing.armor}</td>
                    </tr>
                    <tr>
                        <td>Firepower:</td>
                        <td>{Armorwing.firepower}</td>
                    </tr>
                    <tr>
                        <td>Shot Limit:</td>
                        <td>{Armorwing.shotlimit}</td>
                    </tr>
                    <tr>
                        <td>Venomous:</td>
                        <td>{Armorwing.venom ? "Yes" : "No"}</td>
                    </tr>
                    <tr>
                        <td>Jaw Strength:</td>
                        <td>{Armorwing.jawstrength}</td>
                    </tr>
                    <tr>
                        <td>Stealth:</td>
                        <td>{Armorwing.stealth ? "Yes" : "No"}</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
}
